function isValid(s) {
    // Write your code here
    let letters = new Map()
    letters = getLetters(s)
    let isValid = occuration(letters)
    return isValid ? 'YES' : 'NO'
}

function getLetters(s) {
    let letters = {}
    for (let i of s) {
        letters[i] = (letters[i] || 0) + 1
    }
    return letters
}

function occuration(letters) {
    let occur = letters[s[0]]
    let exception = 0
    let result = true
    for (var key in letters) {
        if (Math.abs(occur - letters[key]) == 1) {
            exception++
            if (exception > 1) {
                result = false
                break
            }
        } 
        if (Math.abs(occur - letters[key]) > 1 ) {
                result = false
                break
        }        
    }
    return result
}

